import React from 'react';
import ResumeDL from './pdf/Resume.pdf';
import './css/Resume.css';
import documentLogo from './assets/document_logo.png';

const Resume = ({ handleMinimizeComponent, setCharacterVisible }) => {
  return (
    <div className="resume-container">
      <div className="contract-header">
        <div className="contract-title">
          <img src={documentLogo} alt="folder" className="folder-logo" />
          <h2>Contract</h2>
        </div>
        {!characterVisible && (
          <img
            src={characterImage} // You might want a different, smaller image or icon here
            alt="Show Character"
            className="character-minimized-icon"
            onClick={() => setCharacterVisible(true)}
          />
        )}
 <div className="right-buttons">
        <button  className="minimize-button" onClick={() => handleMinimizeComponent("contract")}>
          _
        </button>

        <div className="contract-close">
          <a href="/computer">X</a>
        </div>
        </div>
        </div>      
      <a href={ResumeDL} download>
          Download Resume
        </a>
      <div className="resume-preview" >  
          <iframe src={ResumeDL} width="100%" height="200%"></iframe>      

      </div>
    </div>
  );
}

export default Resume;
